void wait_for_vsync(){
	volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
	register int status;
	*pixel_ctrl_ptr = 1;
		
	status = *(pixel_ctrl_ptr + 3);
	while ((status & 0x1) != 0){
		status = *(pixel_ctrl_ptr + 3);
		//*KEYBOARD_input = *KEYBOARD_input & 0xFF; 
	}
}

void draw_box(int x, int y, short int line_color, int length){
	for (int i = 0; i < length; i++){
		for (int j = 0; j < length; j++){
			plot_pixel(x+i, y+j, line_color);
		}
	}
}

void clear_screen()
{
	for (int x = 0; x < RESOLUTION_X; x++){
		for (int y = 0; y < RESOLUTION_Y; y++){
			plot_pixel(x, y, 0x0);
		}
	}
}

void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}


uint16_t rgb888_to_rgb565(uint8_t r, uint8_t g, uint8_t b) {
    uint16_t red5 = (r >> 3) & 0x1F;
    uint16_t green6 = (g >> 2) & 0x3F;
    uint16_t blue5 = (b >> 3) & 0x1F;
    uint16_t rgb565 = (red5 << 11) | (green6 << 5) | blue5;
    return rgb565;
}